import './EAP.css';

function EAP() {
    return(
        <div className="eap">
            <div className="title">
                <h><b>Employee Assistance Program</b></h>
            </div>
            <hr />
            <div className="box">
                <a>Cek seputar kesehatan mental Anda melalui Employee Assistance Program</a>
                <img className="eapbutton" src="/src/files/icons/eapbutton.png"/>
            </div>
        </div>
    )
}

export default EAP;
